import React from 'react'
import Header from '../components/Header.js'
import Footer from '../components/Footer.js'
import CheckoutSection from '../components/CheckoutSection.js'

export default function Checkout() {
  return (
    <>
    <Header/>
    <CheckoutSection/>
    <Footer/>
    </>
  )
}
